import React, { Component } from 'react';
import Header from '../component/Header';
import Row from '../component/Row';
import Footer from '../component/Footer';

class Skills extends Component {
  constructor(props) {
    super(props);
    this.state = {
      tech: [
        '',
        'Express',
        'Node JS',
        'Docker',
        'D3',
        'git',
        'Bootstrap',
        'Webpack',
        'Styled Components',
        'Rest API',
      ],
      blank: [' ', ' ', ' '],
    };
  }

  render() {
    return (
      <div className="App">
        <Header title="Skills"></Header>
        <ul>
          <li>JavaScript</li>
          <li>React</li>
          <li>Express</li>
          <li>Node JS</li>
          <li>Docker</li>
        </ul>
        <ul>
          <li>D3</li>
          <li>git</li>
          <li>Bootstrap</li>
          <li>Webpack</li>
          <li>Styled Component</li>
          <li>Rest API</li>
        </ul>
        <Footer></Footer>
      </div>
    );
  }
}

export default Skills;
